[b]SYNOPSIS[/b]

Tsui Chik, tries to lead a quiet life as a librarian. However, he is really a former test subject for a highly secretive supersoldier project and the instructor of a special commando unit dubbed &quot;701.&quot; The 701 squad is used for many government missions, but after one of the agents kills a team of policemen in an uncontrollable rage, the government decides to abort the project and eliminate all the subjects. Tsui Chik helped the surviving 701 agents flee the extermination attempt. Having escaped, Tsui Chik went separate ways from his team Later, he discovers that rest of the team were responsible for a violent crime spree that was beyond the capability of the local police. He sets out to stop them, donning a disguise and using the superhero alias of &quot;Black Mask&quot;. Having lost the ability to feel pain due to the surgery performed on the super-soldiers by the military, Black Mask is highly invulnerable.


